import * as React from "react";
import "./Home.css";
import Navbars from "../Navbar/navbarHome";
import Footer from "../Footer/Footer";
import { Link } from "react-router-dom";

import { BsArrowRightShort } from "react-icons/bs";

import Online_document from "../../Images/Online_document.png";
import Documents from "../../Images/Documents-amico.png";
import Translator from "../../Images/Translator-bro.png";
import Selecting_team from "../../Images/Selecting_team.png";

import { useNavigate, useLocation } from "react-router-dom";

const Home = () => {
  const location = useLocation();
    const navigate = useNavigate;

  const Doc = location?.state?.languages;
  const pathname = window.location.pathname
  console.log("Doc:", Doc);
  console.log("pathname:", pathname);

  // const [type, settype] = React.useState(null);
  // const [textarea, setTextarea] = React.useState("");
  // const [file, setFile] = React.useState("");

  // const handleChange = (event) => {
  //   setTextarea(event.target.value);
  // };

  // const promotion = (x) => {
  //   window.scrollTo(0, 1500);
  // };

  return (
    <>
      <header className="App-header">
        <Navbars useNavigate={useNavigate}/>
      </header>

      <div>
        <div className="boxleft_overviwe">
          <p className="textHeading1_overviwe">Translation Hero</p>
          <p className="textDescription1_overviwe">
            New options to help you translate
            <br /> the language you want.
          </p>
          <div className="boxleftbutton_overviwe">
            <button className="buttonGetStart_overviwe ">
              <Link
                to="/Signup"
                style={{
                  color: "#FFFF",
                  fontSize: 18,
                  lineHeight: 21,
                  textDecorationLine: "none",
                }}
              >
                Get Start
              </Link>
            </button>
          </div>
        </div>

        <div className="boxBlue_overviwe"></div>
        <div className="boxYellow_overviwe"></div>
        <div className="boxImg1_overviwe">
          <img
            src={Online_document}
            alt="Online_document"
            className="img1_overviwe"
          />
        </div>
      </div>

      <div className="box2_overviwe">
        <div
          style={{
            textAlign: "center",
          }}
        >
          <p className="textHeading2_overviwe">Why Us?</p>

          <div className="ContentBox2_1_overviwe">
            <div
              style={{
                textAlign: "center",
              }}
            >
              <img
                src={Documents}
                alt="Documents"
                className="ContentBox2Img_overviwe"
              />
            </div>

            <p className="textDescriptionBox2_overviwe ">
              translate many documents Official documents with more than 50
              forms to choose from, or general translations such as articles,
              movies,thesis, letters, etc.
            </p>
          </div>

          <div className="ContentBox2_2_overviwe ">
            <div
              style={{
                textAlign: "center",
              }}
            >
              <img
                src={Translator}
                alt="Translator"
                className="ContentBox2Img_overviwe "
              />
            </div>

            <p className="textDescriptionBox2_overviwe ">
              Supports translations for more than 15 languages worldwide.
            </p>
          </div>

          <div className="ContentBox2_3_overviwe ">
            <div
              style={{
                textAlign: "center",
              }}
            >
              <img
                src={Selecting_team}
                alt="Selecting_team"
                className="ContentBox2Img_overviwe "
              />
            </div>

            <p className="textDescriptionBox2_overviwe ">
              We have a team of quality translators both internally and
              externally that guarantee quality, grammatical and safe
              translations.
            </p>
          </div>
        </div>
      </div>

      <div className="box3_overviwe ">
        <div className="ContentBox3_1_overviwe ">
          <p className="textHeading3_1_overviwe ">Customer</p>

          <p className="textDescription2_1_overviwe ">
            For customers who want to translate documents translator hero There
            is a translation system that calculates all costs. Including
            professional translators who guarantee excellent translation
            quality.
          </p>

          <div className="textLink1_overviwe ">
            <Link
              to="/Home/Services/Customer"
              style={{
                color: "#0865A8",
              }}
            >
              see more details
            </Link>
            <BsArrowRightShort />
          </div>
        </div>

        <div className="ContentBox3_2_overviwe ">
          <p className="textHeading3_2_overviwe ">Translator</p>

          <p className="textDescription2_2_overviwe ">
            For translators who want to earn extra money or find work related to
            translation Content of documents that need to reduce working time
            translator hero As an alternative, we can help you because we have a
            document translation support system for you.
          </p>

          <div className="textLink2_overviwe ">
            <Link to="/Home/Services/Translator" style={{ color: "#FFC100" }}>
              see more details
            </Link>
            <BsArrowRightShort />
          </div>
        </div>

        <div className="box4_overviwe ">
          <p className="textHeading4_overviwe ">Translation Hero</p>

          <p className="textDescription3_overviwe ">
            New options to help you translate the language you want.
          </p>

          <div className="boxButtonLink_overviwe ">
            <button
              className="buttonGetStart_overviwe "
              style={{ display: "inline-flex", width: 200, marginTop: 20 }}
            >
              <Link
                to="/Signup"
                style={{
                  color: "#FFFF",
                  fontSize: 18,
                  textDecorationLine: "none",
                }}
              >
                Get Start
              </Link>
            </button>
          </div>
        </div>

        <div>
          <Footer />
        </div>
      </div>
    </>
  );
};
export default Home;
